        class="enter"
        initial={{opacity: 0}}
        animate={{opacity: 1}}
        exit={{opacity: 0}}
        onClick={removeLanding}>
          enter
      </motion.button>
      </MotionConfig>}
    {/* {landingVisible &&
    <button class="enter" onClick={setLandingVisible(false)}>enter</button>
    } */}

  </>;
}

